import React from 'react';
import {Home} from 'Home';
import {Projects} from 'Projects';
import {Contact} from 'Contact';

export default class Nav extends React.Component{
    render(){
        return(
            <div className="nav-container">
                <h1>Anas Alam</h1>
                <nav>
                    <ul className='nav-ul'>
                        <li>
                           <a href={Home}>Home</a> 
                        </li>
                        <li>
                            Projects
                        </li>
                        <li>
                            Contact
                        </li>
                    </ul>
                </nav>
            </div>
        );
    }
}
